import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <input
          type='file'
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"

        >
          upload a file
        </input>
        <label for="myfile">Select a file:</label>
<input  className="App-link" type="file" id="myfile" name="myfile"></input>
      </header>
    </div>
  );
}

export default App;
